import React, { Component } from "react";
import ReactApexChart from "react-apexcharts";

class EarningChart extends Component {
	state = {
		series: [
			{
				name: "Earnings",
				data: [0, 0, 0, 0, 0, 0, 0],
			},
		],
		options: {
			chart: {
				height: 350,
				type: "line",
				zoom: {
					enabled: false,
				},
				dropShadow: {
					enabled: true,
					top: 0,
					left: 0,
					blur: 3,
					opacity: 0.8,
				},
				toolbar: {
					show: false,
				},
			},
			dataLabels: {
				enabled: false,
			},
			stroke: {
				curve: "smooth",
				colors: ["#18c775"],
			},
			title: {
				text: localStorage.getItem("deliveryLastSevenDaysEarningTitle"),
				align: "left",
				style: {
					color: "#fafafa",
				},
			},
			grid: {
				row: {
					colors: ["#222b45", "transparent"], // takes an array which will be repeated on columns
					opacity: 1,
				},
			},
			xaxis: {
				labels: {
					style: {
						colors: ["#fafafa", "#fafafa", "#fafafa", "#fafafa", "#fafafa", "#fafafa", "#fafafa"],
					},
				},
			},
			yaxis: {
				labels: {
					style: {
						colors: ["#fafafa", "#fafafa", "#fafafa", "#fafafa", "#fafafa", "#fafafa", "#fafafa"],
					},
				},
			},
			test: {
				name: "saurabh",
				age: "27",
			},
		},
	};

	componentWillReceiveProps(nextProps) {
		const series = [{ name: "Earnings", data: nextProps.data.chartData }];
		this.setState({ series });
	}

	render() {
		return (
			<React.Fragment>
				<ReactApexChart options={this.state.options} series={this.state.series} type="line" height={350} />
			</React.Fragment>
		);
	}
}

export default EarningChart;
